void LCD_SetCursorPosition(uint16_t x1, uint16_t y1, uint16_t x2, uint16_t y2) {
	
	temp[0] = x1 >> 8;
  temp[1] = x1 & 0xff ;
	temp[2] = x2 >> 8;
	temp[3] = x2 & 0xff ;
	temp[4] = 0x2A ;

	TFT_DC_RESET;
  TFT_CS_RESET;
	HAL_SPI_Transmit(&hspi1, &temp[4], 1, 500);
  TFT_CS_SET;
	
	TFT_DC_SET;
  TFT_CS_RESET;	
  HAL_SPI_Transmit(&hspi1, temp, 4, 500);
  TFT_CS_SET;
	
	
	temp[0] = y1 >> 8;
  temp[1] = y1 & 0xff ;
	temp[2] = y2 >> 8;
	temp[3] = y2 & 0xff ;
	temp[4] = 0x2B ;

	TFT_DC_RESET;
  TFT_CS_RESET;
	HAL_SPI_Transmit(&hspi1, &temp[4], 1, 500);
  TFT_CS_SET;
	
	TFT_DC_SET;
  TFT_CS_RESET;	
  HAL_SPI_Transmit(&hspi1, temp, 4, 500);
  TFT_CS_SET;
}

void LCD_Fill(uint16_t color) {
	unsigned int n, i, j;
	i = color >> 8;
	j = color & 0xFF;
	LCD_SetCursorPosition(0, 0, LCD_WIDTH - 1, LCD_HEIGHT - 1);
	LCD_SendCommand(ILI9341_GRAM);
  n = 0;
	temp[0] = i ;
  temp[1] = j ;
	temp[2] = temp[0] ;
  temp[3] = temp[1] ;
	temp[4] = temp[0] ;
  temp[5] = temp[1] ;
	temp[6] = temp[0] ;
  temp[7] = temp[1] ;
	temp[8] = temp[0] ;
  temp[9] = temp[1] ;
	temp[10] = temp[0] ;
  temp[11] = temp[1] ;	
	temp[12] = temp[0] ;
  temp[13] = temp[1] ;
	temp[14] = temp[0] ;
  temp[15] = temp[1] ;
	temp[16] = temp[0] ;
  temp[17] = temp[1] ;
	temp[18] = temp[0] ;
  temp[19] = temp[1] ;

	
	TFT_DC_SET;
  TFT_CS_RESET;
	while(n < LCD_PIXEL_COUNT)
	
	{
    while(HAL_SPI_Transmit_DMA(&hspi1, temp, 20) != HAL_OK){HAL_SPI_Transmit_DMA(&hspi1, temp, 20);}
		n+=10;	
	}
	
	 TFT_CS_SET;
}

