void LCD_Draw_text_line (uint16_t x, uint16_t y)
{

	LCD_SetCursorPosition(x, y, x+40, y);
	temp[2] = ILI9341_GRAM ;
	
	TFT_DC_RESET;
  TFT_CS_RESET;
	HAL_SPI_Transmit(&hspi1, &temp[2], 1, 500);
  TFT_CS_SET;
	
	TFT_DC_SET;
  TFT_CS_RESET;	
  HAL_SPI_Transmit(&hspi1, text_line, 64, 500);
  TFT_CS_SET;	
	
}


uint32_t LCD_Putchar(uint16_t x, uint16_t y, char c, uint8_t invers) 
{
	
	      uint8_t i, j, bytes;
	      uint16_t offset;
	      uint64_t Data;
	      uint64_t Data_temp;
	      uint8_t temp = 0;
	      uint16_t temp_char = c;
	      if (temp_char > 126){offset = (c-49)*161;}else{offset = (c-32)*161;}	
				uint16_t tochka =   0x1F53;
				uint16_t fon    =   0x0386;				
		 
		  temp = 1;
		  for (i = 1; i < 31; i++)  // 		  for (i = 0; i < 32; i++) 
	   {
        Data_temp = TimesNewRoman.data_table[offset+temp+4] << 8;
        Data = ((TimesNewRoman.data_table[offset+temp]) + (TimesNewRoman.data_table[offset+temp+1] << 8) + (TimesNewRoman.data_table[offset+temp+2] << 16) + (TimesNewRoman.data_table[offset+temp +3] << 24) + (Data_temp << 24));                
        bytes = 0;
            for (j = 32 ; j > 0; j--) 
	         {					 	                    
    						 if (((Data >> j) & 1) ^ (invers)) {
									 text_line[bytes] = tochka >> 8; bytes++; text_line[bytes] = tochka & 255;bytes++;  // текст
                } else {
                   text_line[bytes] = fon >> 8; bytes++; text_line[bytes] = fon & 255;bytes++;  //фон
                }
								
            } 
				LCD_Draw_text_line(x, y); y++;
		    temp += 5;
		 }		 
        return y - 5;		 
	//------------------------------------------------------------------------------------------------------------------------------------------		 
}

void LCD_DrawString(uint16_t x, uint16_t y, char *str, uint8_t invers)
{
    while(*str) {		           
                 if (*str > 125){str++;}								 
		             y = LCD_Putchar(x,y,*str++, invers);	                		
		            }
}


